import React from 'react'
import './Logo.css'
import { Link, useNavigate } from 'react-router-dom'

export default function Logo() {

    const navigate = useNavigate()

    const onClick = (e) => {
        e.preventDefault()
        navigate('/', {})
    }

return (
<div className='logo'>
    <Link onClick={onClick} to='/'>LogoLogo</Link>
</div>
)
}
